import './App.css';

function App1() {
  return (
    <div className="App1">
      <header className="App1-header">
      <p>Hello, Sara</p>
      </header>
    </div>
  );
}



function App2() {
  return (
    <div className="App2">
      <header className="App2-header">
      <p>Hello, Andrei</p>
      </header>
    </div>
  );
}

export default App2;
